import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const NotePage = () => {
  const id = useParams();
  const noteId = id.
  const [note, setNote] = useState([]);


  useEffect(() => {
    getNote();
  }, [id]);

  let getNote = async () => {
    let response = await fetch(`/api/notes/${id}/`);
    let data = await response.json();
    setNote(data);
  };

  return (
    <div>
      <h3>{note?.body}</h3>
    </div>
  );
};

export default NotePage;
